import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import axios from 'axios'
import { Table } from 'reactstrap'


class App extends React.Component{

  constructor(props){
    super(props)
    this.state={
      items:[],
      flag:'hhhh'
    }
  }


async componentDidMount(){
  await axios.get('http://localhost:5000/')
  .then((response)=>{
    console.log(response.data.countries)
    this.setState({items:response.data.countries,flag:'yyy'})})
  .catch((err)=>console.log(err))






  }


render(){

  return(
  <div className='table'>
      <Table dark>
      <thead>
        <tr>
          <th>STATES</th>
          <th>CONFIRMED</th>
          <th>ACTIVE</th>
          <th>RECOVERED</th>
          <th>DEATHS</th>

        </tr>
      </thead>
      <tbody>
        <tr>
          <th scope="row">1</th>
          <td>Mark</td>
          <td>Otto</td>
          <td>@mdo</td>
        </tr>
        <tr>
          <th scope="row">2</th>
          <td>Jacob</td>
          <td>Thornton</td>
          <td>@fat</td>
        </tr>
        <tr>
          <th scope="row">3</th>
          <td>Larry</td>
          <td>the Bird</td>
          <td>@twitter</td>
        </tr>
      </tbody>
    </Table>

      <h1>{this.state.flag}</h1>
     <ul>{this.state.items.map(item=>
      <li key={item.id}>{item.name}</li>
     )}</ul>


   </div>
    )}


}

ReactDOM.render(
  <App/>,
  document.getElementById('root')
);

